import React from "react";
import { IoCloseCircleOutline } from "react-icons/io";

function Todo(props) {

    return (
        <div className='todo'>
            <span className='todo-text'>{props.todo.text}</span>
            <div className='todo-buttons'>
                <IoCloseCircleOutline className='todo__delete-button'/>
                <button className='todo__edit-button'>Edit</button>
                <button className='todo__complete-button'>Complete</button>
            </div>
        </div>
    )
}

export default Todo
